import * as React from 'react';
import DvMenu from '../DVComponents/dvmenu';

class App extends React.PureComponent<{}> {

    public componentDidMount() {
    }
    row = () => {
        var rows = [];
        for (let i = 0; i<2; i++) {
            rows.push(<DvMenu/>);
        }
        return rows;
     }
    public render() {
        return (
            <div>
            <DvMenu/>
            {this.row()}
            </div>
        );
    }
}

export default App;
